l replicated site files need to be uploaded to this folder.\",\"All replicated site files need to be uploaded to this folder.\"],[\"Site url\",\"Site url\"],[\"Upload .htaccess to\",\"Upload .htaccess to\"],[\"Check if it is working\",\"Check if it is working\"],[\"Generate .htaccess\",\"Generate .htaccess\"],[\"Replicated site\",\"Replicated site\"],[\"If you deactivate Site replication feature, all site banners will be deleted. Are you sure you want to deactivate this feature?\",\"If you deactivate Site replication feature, all site banners will be deleted. Are you sure you want to deactivate this feature?\"],[\"Installer Welcome\",\"Installer Welcome\"],[\"AboutDescription\",\"About the application\"],[\"You are running latest version.\",\"You are running latest version.\"],[\"Checking for new version...\",\"Checking for new version...\"],[\"Change log\",\"Change log\"],[\"Latest version %s is available for download.\",\"Latest version %s is available for download.\"],[\"Are you sure you want to do this operation on the table?\",\"Are you sure you want to do this operation on the table?\"],[\"DatabaseStatusDescription\",\"Overview of your database \\u2013 quickly check the size of your tables, optimize or repair them if necessary.\"],[\"GetStartedBrainstorming\",\"This first step is very important - think about your affiliate program.<br\\/>\\r\\nYou should have a plan of what you want to achieve. How big commissions can you afford to provide?<br\\/>\\r\\nWill they be attractive to affiliates compared with your competition?\\r\\nHow to attract affiliates to join?\"],[\"Mail Account\",\"Mail Account\"],[\"MailAccountDescription\",\"Set up mail account that will be used for sending emails by the system\"],[\"Email Templates\",\"Email Templates\"],[\"EmailTemplatesDescription\",\"Edit templates for all emails automatically sent by the system\"],[\"TrackingSettingsDescription\",\"Configure everything related to the referrals and sales, like link styles, IP address tracking, DirectLink\"],[\"Payout Options\",\"Payout Options\"],[\"PayoutOptionsDescription\",\"Define payout options (PayPal, Check, Moneybookers etc.) here. Our flexible system allows you to define any payout option\"],[\"Review your settings\",\"Review your settings\"],[\"GetStartedSettings\",\"Post Affiliate Pro is made in a way that it can work with the default configuration.<br\\/>However, you should check the configuration and fine tune it for your own needs.<br\\/>You can find the configuration screen under the <strong>Config & Tools menu -> Configuration<\\/strong>.<br\\/><br\\/>The detailed description of all configuration options can be found in the user's guide or knowledgebase.\"],[\"Campaign manager\",\"Campaign manager\"],[\"CampaignsListDescription\",\"Manage your campaigns here.<br\\/>Campaign represents a product or group of products that have the same commissions. You can create unlimited number of campaigns.\"],[\"CampaignsOverviewDescription\",\"Overview of your campaigns and commissions generated\"],[\"Define your commissions\",\"Define your commissions\"],[\"GetStartedCommissions\",\"One default campaign is created during the installation. You can modify it, or create your own campaigns.<br\\/><br\\/>\\r\\nCampaigns are used to group a set of products (or only one product) that have the same commission settings.<br\\/><br\\/>\\r\\nFor example, you can have campaign for Product1, where you'll reward your affiliates per click, and another campaign for Product2, where affiliate receives commissions per sale.<br\\/><br\\/>\\r\\nOr you can have campaign called Low cost products, which will have 40% per sale commissions, and another campaign called Expensive products with 15% per sale commission.\"],[\"Banners manager\",\"Banners manager\"],[\"BannersListDescription\",\"Manage your banners here.<br\\/>You can create banners of different types, like image banners, text links, Flash or HTML banners.<br\\/>Every banner belongs to a campaign (that defines commissions for the referral), and it can link to any target URL.\"],[\"Add banners and other creatives\",\"Add banners and other creatives\"],[\"GetStartedCreatives\",\"In the <strong>Banners manager<\\/strong> you can various creatives, from text links, standard image banners to HTML, Flash and promo email banners.<br\\/>\\r\\nEvery banner must have destination URL specified - it is the URL where the visitor is redirected after click.\"],[\"Set up emails\",\"Set up emails\"],[\"GetStartedEmails\",\"You should set up emailing functionality. This includes: <ul><li><strong>mail account<\\/strong> - how the emails are sent. You can choose either mail() function or SMTP server.<\\/li><li><strong>email templates<\\/strong> \\u2013 these are templates that are used when system sends automatic emails, like after signup or after sale notifications<\\/li><li><strong>email notifications<\\/strong> \\u2013 you can configure what kind of  notifications you would like to receive as merchant, and what notifications will be available for affiliates.<\\/li><\\/ul>Make sure that mail account is set up properly \\u2013 try to test sending emails. Without working emails the affiliates will not receive confirmation about their signups, etc.\"],[\"ThemesSettingsDescription\",\"Choose logo and theme (look & feel) for your panels and signup page\"],[\"Affiliate signup\",\"Affiliate signup\"],[\"SignupFormSettingsDescription\",\"Contents and settings of the signup form\"],[\"Customize your affiliate signup form\",\"Customize your affiliate signup form\"],[\"GetStartedSignupForm\",\"Check the standard signup form, and customize it if you want.<br\\/><br\\/>\\r\\nThe signup form comes with an information mini-site that contains information about the affiliate program, etc.<br\\/>You can use the mini-site, or delete it and use only signup form.\"],[\"Affiliate panel\",\"Affiliate Panel\"],[\"AffPanelSettingsDescription\",\"Contents of affiliate panel. You can fully customize the menu and content of this panel, you can even create your own pages\"],[\"Customize affiliate panel\",\"Customize affiliate panel\"],[\"GetStartedAffPanel\",\"Affiliate panel in Post Affiliate Pro is very flexible.<br\\/>You can configure how the menu will look like, what content you want to have there, and even write your own content or link to another pages.\"],[\"Integrate with your web page & shop\",\"Integrate with your web page & shop\"],[\"GetStartedIntegrate\",\"Integration is a way to connect the affiliate system to your current website, shopping cart or payment gateway in a way that affiliate system will be notified about referrals and purchases.<br\\/>\\r\\nWhen notified, affiliate system registers the sale, finds referring affiliate (if any) and creates appropriate commission for him.<br\\/><br\\/>\\r\\nIntegration usually means adding few lines of code into your pages, and it is described step-by-step  in the Integration guide for most common shopping carts and payment systems. \"],[\"Event Logging\",\"Event Logging\"],[\"LoggingDescription\",\"Enables you to select logging level for the system, and debug the system actions.\"],[\"LogsListDescription\",\"List of events registered by the affiliate system.<br\\/>They can help you troubleshoot problems with tracking, just turn on error logging and you'll see every action of the system.\"],[\"Test everything\",\"Test everything\"],[\"GetStartedTest\",\"When you have configured your campaigns, defined correct commissions, and created some banners\\/links, you should test the system.<br\\/>\\r\\nThe best is to simulate the whole process from affiliate\\u2019s and your point of view:\\r\\n<ol>\\r\\n<li>Sign up as some testing affiliate \\u2013 after approval you should receive confirmation email with your password, and you should be able to log in to your affiliate panel<\\/li>\\r\\n<li>Log in to affiliates panel, get the code for banners\\/links and put them\\u00a0onto some testing page<\\/li> \\r\\n<li>Click on the banner and check that the click is registered<\\/li>\\r\\n<li>After the click, try to make test sale and check that sale commission was registered in affiliate system (only for per sale or per lead commissions)<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\nIf you experience some problems in any of these steps, turn on <strong>Debug event logging<\\/strong> and look at <strong>Troubleshooting<\\/strong>\"],[\"Promote your affiliate program\",\"Promote your affiliate program\"],[\"GetStartedPromote\",\"After you have successfully tested integration of affiliate system with your website, everything is ready to start up promoting your new affiliate program so that you'll attract new affiliates to join it.<br\\/><br\\/>\\r\\nIt is a must to put link to your affiliate program information or signup form to your own website. Name the link like Affiliate program, Webmasters make money, Affiliates etc. This will attract the visitors of your site and can convert them to your affiliates.<br\\/><br\\/>\\r\\nTo reach more potential affiliates, submit your program to affiliate directories. There are tens of affiliate directories on the web, visited by thousands of experienced affiliates every day.\"],[\"Getting Started\",\"Getting Started\"],[\"MerchantHomeDescription\",\"Below you see tasks that are waiting for your approval and overview of the affiliate program traffic\"],[\"Merchant panel tutorial video\",\"Merchant panel tutorial video\"],[\"In this video Chuck Lasker explains and clicks through basic forms of merchant control panel. He will show you how to navigate through main sections of application. In same time you can see in action how responsive is merchant application based on new Web 2.0 user interface.\",\"In this video Chuck Lasker explains and clicks through basic forms of merchant control panel. He will show you how to navigate through main sections of application. In same time you can see in action how responsive is merchant application based on new Web 2.0 user interface.\"],[\"Ch